using ApiBook.Application.Interfaces;
using ApiBook.Application.Services;
using ApiBook.Domain.Entities;
using ApiBook.Domain.Repositories;
using Microsoft.Extensions.Configuration;
using Moq;
using System;
using System.Collections.Generic;
using System.Threading.Tasks;
using Xunit;

namespace ApiBook.Tests.Application.Services
{
    public class BookServiceTests
    {
        private readonly Mock<IBookRepository> _mockBookRepository;
        private readonly Mock<IConfiguration> _mockConfiguration;
        private readonly BookService _bookService;

        public BookServiceTests()
        {
            _mockBookRepository = new Mock<IBookRepository>();
            _mockConfiguration = new Mock<IConfiguration>();

            _bookService = new BookService(_mockBookRepository.Object, _mockConfiguration.Object);
        }

        [Fact]
        public async Task FindAll_ShouldReturnListOfBooks_WhenCalled()
        {
            // Arrange
            var expectedBooks = new List<Book> { new Book(), new Book() };
            _mockBookRepository.Setup(x => x.FindAll()).ReturnsAsync(expectedBooks);

            // Act
            var result = await _bookService.FindAll();

            // Assert
            Assert.Equal(expectedBooks, result);
        }

        [Fact]
        public async Task GetById_ShouldReturnBook_WhenCalledWithValidId()
        {
            // Arrange
            var id = Guid.NewGuid();
            var expectedBook = new Book { Id = id };
            _mockBookRepository.Setup(x => x.GetById(id)).ReturnsAsync(expectedBook);

            // Act
            var result = await _bookService.GetById(id);

            // Assert
            Assert.Equal(expectedBook, result);
        }

        [Fact]
        public async Task Add_ShouldAddBookAndReturnEmptyString_WhenCalledWithValidBook()
        {
            // Arrange
            var expectedResponse = string.Empty;
            var book = new Book { Cover = GetBase64Image() };
            _mockBookRepository.Setup(x => x.Add(book)).Returns(Task.CompletedTask);
            _mockConfiguration.Setup(x => x.GetSection("S3:UriBucket").Value).Returns("http://s3.storage.com/");

            // Act
            var result = await _bookService.Add(book);

            // Assert
            Assert.Equal(expectedResponse, result);
            _mockBookRepository.Verify(x => x.Add(book), Times.Once);
        }

        [Fact]
        public async Task Update_ShouldUpdateBookAndReturnEmptyStringOnlyWithPropertiesChanged_WhenCalledWithValidBook()
        {
            // Arrange
            var expectedResponse = string.Empty;
            var originalBook = new Book { Id = Guid.NewGuid(), Cover = "OriginalCover", Author = "OriginalAuthor", LaunchYear = 2000, Title = "OriginalTitle" };
            var updatedBook = new Book { Id = originalBook.Id, Title = "UpdatedTitle" };

            _mockBookRepository.Setup(x => x.GetById(originalBook.Id)).ReturnsAsync(originalBook);
            _mockConfiguration.Setup(x => x.GetSection("S3:UriBucket").Value).Returns("http://s3.storage.com/");
            _mockBookRepository.Setup(x => x.Update(originalBook)).Returns(Task.CompletedTask);
            _mockBookRepository.Setup(x => x.FindAll()).ReturnsAsync(new List<Book>());
            _mockBookRepository.Setup(x => x.Remove(It.IsAny<Guid>())).Returns(Task.CompletedTask);

            _mockBookRepository.Verify(x => x.Update(originalBook), Times.Never);

            // Act
            var result = await _bookService.Update(updatedBook);
            originalBook.Title = "UpdatedTitle";

            // Assert
            Assert.Equal(expectedResponse, result);
            _mockBookRepository.Verify(x => x.Update(originalBook), Times.Once);
        }

        [Fact]
        public async Task Update_ShouldUpdateBookWithoutUploadingToS3_WhenCalledWithoutCover()
        {
            // Arrange
            var expectedResponse = string.Empty;
            var originalBook = new Book { Id = Guid.NewGuid(), Cover = "OriginalCover" };
            var updatedBook = new Book { Id = originalBook.Id };

            _mockBookRepository.Setup(x => x.GetById(originalBook.Id)).ReturnsAsync(originalBook);
            _mockConfiguration.Setup(x => x.GetSection("S3:UriBucket").Value).Returns("http://s3.storage.com/");

            _mockBookRepository.Verify(x => x.Update(originalBook), Times.Never);

            // Act
            var result = await _bookService.Update(updatedBook);

            // Assert
            Assert.Equal(expectedResponse, result);
            _mockBookRepository.Verify(x => x.Update(originalBook), Times.Once);

        }

        [Fact]
        public async Task Delete_ShouldRemoveBook_WhenCalledWithValidId()
        {
            // Arrange
            var id = Guid.NewGuid();

            // Act
            await _bookService.Delete(id);

            // Assert
            _mockBookRepository.Verify(x => x.Remove(id), Times.Once);
        }

        private string GetBase64Image()
        {
            return "";
        }
    }
}
